    <div>
      <div className="tasks">Дискриминант</div>
      <div className="tasks">высшая математика</div>
      <div className="tasks">Информатика за 9 класс</div>
      <div className="tasks">Физрук лох</div>
      <div className="tasks">Ядерная физика</div>
      <div className="tasks">Русский язык для умных</div>
    </div>
  );
}

ReactDOMClient.render(<Tasks />, document.getElementById('root'));

